import React from 'react';
import Navbar from './Navbar';

const Account = () => {
    return (
        <div>
            <Navbar/>
           
            <div className="divcss">
                <h2>Account Page</h2>
            </div>
            <div className="divcss">
                <h3>Account</h3>
                <p>ID</p>
                <p>Name</p>
                <p>Email</p>
                <p>Password</p>
                <p>Age</p>
                <p>Gender</p>
                <p>AccountType</p>
            </div>
            <div className="divcss">
                <h3>User Profile 1 - Main</h3>
            </div>
        </div>
    );
};

export default Account;
